<html><head><meta http-equiv="Content-Type" content="text/html; charset=windows-1252">

	<style type="text/css">
		
		counter

	</style>
	
</head>
<body>

	<div id="wins" class="counter"></div>
	<div id="losses" class="counter"></div>

	<script type="text/javascript">
		 
		let time = 0;
		function rate () {
			time == time + 0.1
			console.log(time);
		}

		setInterval(rate, 10);
		setInterval(makeCovid, time);
		let deaths = 0;
		let saves = 0;
		let height = screen.availHeight - 250;
		let weight = screen.availWidth - 250;

		
		function makeCovid () {
			let face = document.createElement("div")
			let cure = false
			document.body.appendChild(face);

			face.style.backgroundImage = "url(sickface.png)";
			face.style.backgroundSize = "contain";
			face.style.width = "50px";
			face.style.height = "50px";
			// face.style.display = "inline-block"
			face.style.position = 'absolute';
			face.style.left = Math.random()* weight + "px"
			face.style.top = Math.random()* height + "px";
			
			function happyface(){ 
				face.style.backgroundImage = "url(happyface.png)";
				cure = true;
				saves = saves + 1;
			}

			function dying(){
				if (cure == false){
					face.style.backgroundImage = "url(deadface.png)";
					face.removeEventListener("click", happyface) 
					deaths = deaths + 1;
				}

			}
	
			function die(){
				if (cure == false) {
					setInterval(dying, 5000);
				}
				else {
				console.log("hi");
				}
			
			}	

			die();
			face.addEventListener("click", happyface)		
						
		}

	</script>
